// ==UserScript==
// @name         Multporn Blur Killer
// @namespace    https://github.com/Official-Husko/violentmonkey-scripts
// @version      1.0.0
// @description  Removes the blur on comic headers
// @author       Official Husko
// @match        https://multporn.net/*
// @icon         data:image/png;base64,
// @grant        none
// ==/UserScript==

(function() {
    'use strict';

    // Original and Replacement URLs for images
    var originalURL = 'https://multporn.net/sites/default/files/styles/blur_comics/';
    var replacementURL = 'https://multporn.net/sites/default/files/styles/random_comics/';

    // Function to replace the images on the page
    function replaceImages() {
        var imgElements = document.querySelectorAll('img');
        imgElements.forEach(function(img) {
            var currentSrc = img.getAttribute('src');
            if (currentSrc && currentSrc.includes(originalURL)) {
                var newSrc = currentSrc.replace(originalURL, replacementURL);
                img.setAttribute('src', newSrc);
            }
        });
    }

    // Run the replacement function every second (1000 milliseconds)
    setInterval(replaceImages, 1000);
})();